def isSubsequence(s, t):
    if s=="":
        return True
    i=j=0
    first=""
    while i <len(s):
        first=s[i]
        while j < len(t):
            if first==t[j]:
                # print(first)
                # print("yea")
                if i==len(s)-1:
                    return True
                j+=1
                break
            else:
                j+=1
        i+=1
        if i<=len(s)-1:
            first=s[i]
        # print(first)
        # print(j)
        # print(t[j])
        print(i)
        if j>=len(t)-1:
            if i < len(s)-1:
                return False
            elif j <=len(t)-1:
                if t[j]==first:
                    return True
            print("IOIAOI")
            return False
    return False
